import React, { Component } from 'react';
import { MyContext } from '../contexts/ThemeContext';

class Navbar extends Component {
  static contextType=MyContext;
  render() { 
    console.log(this.context)
    return ( 
      <nav>
        <h1>Context App</h1>
        <ul>
          <li>Home</li>
          <li>About</li>
          <li>Contact</li>
        </ul>
      </nav>
    );
  }
}
 
export default Navbar;
